import StartPage from "./Components/StartPage";
import Quizz from "./Components/Quizz";
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div>
      <StartPage />
      <Switch>
        <Route>
          <Quizz />
        </Route>
      </Switch>
    </div>
    </Router>
  );
}

export default App;
